var f = ['👶🏻','🧒🏻','🧑🏻','👨🏻','🧔🏻','👴🏻'];

function loop() {
    window.location.pathname = f[Math.floor((Date.now()/100)%f.length)];
    setTimeout(loop, 450);
}
loop();
